  `sex` int(11) DEFAULT NULL COMMENT '性别（1：男 2：女）',
  `email` varchar(45) DEFAULT NULL COMMENT '电子邮件',
  `phone` varchar(45) NOT NULL COMMENT '电话',
  `phoneVerification` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否验证',
  `roleid` varchar(255) DEFAULT NULL COMMENT '角色id 1系统用户6普通用户',
  `superior` varchar(255) NOT NULL COMMENT '上级id',
  `superiorSecond` varchar(255) DEFAULT NULL COMMENT '上上级id',
  `superiorThird` varchar(255) DEFAULT NULL COMMENT '上上上级id',
  `superiorTop` varchar(255) DEFAULT NULL COMMENT '顶级id',
  `superiors` text COMMENT '所有上级id',
  `status` int(11) DEFAULT '1' COMMENT '状态(1：启用  2：冻结  3：删除）',
  `createtime` date DEFAULT NULL COMMENT '创建时间',
  `cardID` varchar(255) DEFAULT NULL COMMENT '身份证',
  `cardType` int(11) NOT NULL COMMENT '身份证类型1大陆身份证2港澳台身份证3国外身份证',
  `cardPic` varchar(255) NOT NULL DEFAULT '0' COMMENT '身份证照片',
  `level` int(11) NOT NULL DEFAULT '0' COMMENT '用户等级(1法人2一级股东3二级股东4核心技术部5公司公众号6员工7商家8认证会员9注册会员)',
  `weiXin` varchar(50) DEFAULT NULL COMMENT '微信号',
  `cash` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT ' 现金账户',
  `stockPoints` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '库存积分',
  `points` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '积分',
  `cloudPoints` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '云积分',
  `onlyPayPoints` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '消费积分',
  `QRcode` varchar(255) DEFAULT NULL COMMENT '二维码',
  `verification` tinyint(4) NOT NULL DEFAULT '0' COMMENT '验证状态0未验证1验证中2已验证',
  `managerApply` bit(1) NOT NULL DEFAULT b'0' COMMENT '充值管理员',
  `managerOrder` bit(1) NOT NULL DEFAULT b'0' COMMENT '订单管理员',
  PRIMARY KEY (`id`),
  KEY `account` (`account`)
) ENGINE=InnoDB AUTO_INCREMENT=100 DEFAULT CHARSET=utf8 COMMENT='管理员表';

